import axios from 'axios'
import React, { useEffect, useState } from 'react'
import { Link, Outlet } from 'react-router-dom'

const HomeJ = () => {
  const[myrecipe,setmyrecipe]=useState([])
  useEffect(function(){
    axios.get('http://localhost:1234/Recipes/getAll').then(l=>{setmyrecipe(l.data)})
  },[])
  return  <div>
    {myrecipe?.map(n=><p key={n.name}><Link to={`mymoredetails/${n.name}/${n.description}/${n.pic}/${n.level}/${n.duration}/${n.type}/${n.id}/${n.component}`}>{n.name}--
    <div style={{width:2, height:2}}><img src={n.pic}></img></div></Link><br></br></p>)}
    <Outlet></Outlet>
    </div>
}

export default HomeJ
